import { FormUserLogin } from "../../components/FormUserLogin";
import { Header } from "../../components/Header";
import { LoginImage } from "../../components/LoginImage";
import { LoginContainer } from "./styles";

export const Login = () => {
  return (
    <>
      <Header />
      <LoginContainer>
        <LoginImage />
        <FormUserLogin />
      </LoginContainer>
    </>
  );
};
